    func_m = re.search('(?x)\n                (?:function\\s+%s|[{;,]\\s*%s\\s*=\\s*function|var\\s+%s\\s*=\\s*function)\\s*\n                \\((?P<args>[^)]*)\\)\\s*\n                \\{(?P<code>[^}]+)\\}' % (re.escape(funcname), re.escape(funcname), re.escape(funcname)), self.code)
    if func_m is None:
        raise ExtractorError('Could not find JS function %r' % funcname)
